import React from "react";
import landmarks from "../landmarks";


function App(){
    return (
        <div>
            <h1>Famous Landmarks</h1>
            <Card name={landmarks[0].landmark} image={landmarks[0].imgURL} location = {landmarks[0].location} />
            <Card />
            <Card />
        </div>
    );
}

export default App;
